    cmsService.getGuildList(req, metadata, (err, resp) => {
        if (!err) {
            const arr = []
            const list = resp.getGuildsList()
            list.forEach((item, index)=>{
                const json = {
                    value : item.getId(),
                    label : item.getName(),
                    areaId : item.getAreaId()
                }
                arr.push(json)
            })
            resolve(arr)
        } else {
            console.log(err)
        }
    })
})
export function getGuildList(isShowAll) {
    let guildArr = sessionStorage.getItem("guildArr");

    let newList = JSON.parse(guildArr)
    if(isShowAll){
        newList.unshift({
            isAnchor: false,
            label: "",
            os: 0,
            value: undefined
        })
    }
    return newList
}

export function getGuildListByAreaId(val, isShowAll){
    let guildList = getGuildList()

    let newList = []
    if(val === 0){
        newList = guildList
    }else{
        guildList.forEach(item => {
            if(item.areaId === val){
                newList.push(item)
            }
        })
    }
    if(isShowAll){
        newList.unshift({
            isAnchor: false,
            label: "",
            os: 0,
            value: undefined
        })
    }
    return newList
}


