export function getApps(callback) {
    const req = new AppListRequest();
    const metadata = {'token': getToken()};
    cmsService.getAppList(req, metadata, (err, resp) => {
        console.log("getAppList:" + err)
        console.log("getAppList resp:" + resp)
        if (!err) {
            const arr = []
            const list = resp.getAppsList()
            list.forEach((item, index)=>{
                const json = {
                    value : item.getId(),
                    label : item.getTitle(),
                    os : item.getOsType(),
                    isAnchor: item.getIsAnchor(),
                    areaIds: item.getAreaIdsList()
                }
                arr.push(json)
            })
            callback(arr)
        } else {
            console.log(err)
        }
    })
}
export function getAppList(isFilter) {
    let appArr = sessionStorage.getItem("appArr");
    let arr = JSON.parse(appArr)
    if(isFilter){
        let result = []
        arr.forEach(item => {
            if(!item.isAnchor){
                result.push(item)
            }
        })
        return result
    }else{
        return arr
    }
}



